INSERT INTO `contents` VALUES (1,'privacy_policy','سياسة الخصوصية','نحن في تطبيق سلايد نلتزم بحماية خصوصيتك وبياناتك الشخصية. نحن نجمع فقط المعلومات الضرورية مثل الاسم ورقم الهاتف والبريد الإلكتروني لتوفير تجربة آمنة ومميزة. لا نشارك بياناتك مع أطراف ثالثة دون موافقتك الصريحة، إلا في الحالات التي يتطلبها القانون. نستخدم أحدث تقنيات التشفير لحماية معلوماتك. يمكنك في أي وقت تحديث أو حذف بياناتك الشخصية. قد نحدث هذه السياسة من وقت لآخر، واستمرار استخدامك للتطبيق يعني موافقتك على التحديثات. هدفنا هو توفير بيئة استثمار آمنة وموثوقة لجميع المستخدمين.','2025-10-14',1,'2025-10-14 19:44:33','2025-10-14 19:44:33'),(2,'terms_conditions','الشروط والأحكام','باستخدام هذا التطبيق، فإنك توافق على الالتزام بالشروط والأحكام التالية. يمنع استخدام التطبيق لأي غرض غير قانوني أو احتيالي. يتحمل المستخدم مسؤولية دقة البيانات التي يقدمها سواء كمستثمر أو كصاحب مشروع. تحتفظ إدارة التطبيق بالحق في مراجعة أو حذف أي محتوى مخالف أو غير موثوق. لا تتحمل إدارة التطبيق مسؤولية أي خسائر ناتجة عن قرارات استثمارية يتخذها المستخدم بناء على المعلومات المتاحة. يُمنع إعادة استخدام أو نسخ محتوى التطبيق بدون إذن كتابي. يحق للإدارة تعديل هذه الشروط في أي وقت مع إشعار المستخدمين بذلك. استمرار استخدامك للتطبيق يعني موافقتك الكاملة على الشروط الحالية والمحدثة.','2025-10-14',1,'2025-10-14 19:44:33','2025-10-14 19:44:33'),(3,'about_app','عن التطبيق','تطبيق سلايد هو منصة استثمارية مبتكرة تربط بين أصحاب المشاريع الطموحين والمستثمرين الباحثين عن فرص استثمارية مربحة. في سلايد، يمكن لأصحاب المشاريع عرض أفكارهم ومشاريعهم مع تفاصيل شاملة وواضحة، بينما يمكن للمستثمرين تصفح المشاريع المتاحة وتقييمها بناءً على بيانات واضحة وشفافة. نحن نلتزم بتوفير بيئة آمنة وعادلة وسهلة الاستخدام، مع ضمان التواصل المباشر بين الأطراف المعنية. نسعى لتحقيق أعلى معايير الحماية والجودة والمصداقية في جميع عملياتنا. هدفنا هو تمكين رواد الأعمال وتوسيع آفاق المستثمرين، مما يساهم في نمو الاقتصاد المحلي والإقليمي. انضم إلينا اليوم واكتشف عالم الفرص الاستثمارية المتنوعة.','2025-10-14',1,'2025-10-14 19:44:33','2025-10-14 19:44:33');
