INSERT INTO `faqs` VALUES (1,'عن تطبيق سلايد؟','تطبيق سلايد هو منصة استثمارية مبتكرة تربط بين أصحاب المشاريع والمستثمرين. نقدم بيئة آمنة وشفافة للاستثمار في المشاريع الواعدة.',1,1,'2025-10-14 19:44:33','2025-10-14 19:44:33'),(2,'هل طريقة الاستثمار امنة؟','نعم، نستخدم أحدث تقنيات التشفير ونتبع أفضل الممارسات الأمنية لحماية استثماراتك وبياناتك الشخصية.',2,1,'2025-10-14 19:44:33','2025-10-14 19:44:33'),(3,'كيف يمكنني استرداد أموالي؟','يمكنك استرداد أموالك من خلال المحفظة الإلكترونية في التطبيق. عملية الاسترداد تتم خلال 1-3 أيام عمل.',3,1,'2025-10-14 19:44:33','2025-10-14 19:44:33'),(4,'ما هي الحدود الدنيا والعليا للاستثمار؟','تختلف الحدود حسب المشروع، ولكن عادة تتراوح بين 100 ريال كحد أدنى و 50,000 ريال كحد أقصى للمشروع الواحد.',4,1,'2025-10-14 19:44:33','2025-10-14 19:44:33'),(5,'كيف يمكنني التواصل مع فريق الدعم؟','يمكنك التواصل معنا من خلال قسم الدعم في التطبيق أو عبر البريد الإلكتروني. فريق الدعم متاح 24/7 لمساعدتك.',5,1,'2025-10-14 19:44:33','2025-10-14 19:44:33');
